import React, {Component} from 'react';
import {
    View,
    KeyboardAvoidingView,
    TextInput,
    StyleSheet,
    Text,
    Platform,
    TouchableWithoutFeedback,
    Button,
    Keyboard
} from 'react-native';
import MyButton from "./MyButton";
import User from './User'

export default class extends Component {
    constructor() {
        super();
        this.state = {username: '', password: ''}
    }

    render() {
        const data = this.props.route.params.users
        console.log(data)
        const renderItem = ({user}) =>(<User name={user.name} password={user.password} date={user.date} id={user.id} navigate={this.props.navigation}/>)
        return (
            <SafeAreaView>
                <FlatList
                    data={data}
                    renderItem={renderItem}
                    keyExtractor={item => item.id}
                />
            </SafeAreaView>
        )
            ;
    }
}
